// this line should not be removed
var wWhereToStay = angular.module( "wWatsonPanel",[]);

wWhereToStay.controller( "wWatsonPanelController", function( $scope ) {
	var dq = new DataQuery( 'qWatsonQuestion' );
	dq.execute().
	done( function() {
		$scope.$apply(function() {
			$scope.results = (dq.getData()[0].question.evidencelist).slice(0,10);
		});
	});
	$scope.myFunction = function(arg) {
        $.SmartMessageBox({
            title : "This is a <b>Watson Recommendation</b>",
            content : arg,
            buttons : '[Ok]'
        }, function(ButtonPressed) {

        });
};

});
wWhereToStay.filter('summerize',function(){
     return function (item) {
    return (item.split(' ').slice(0,39).join(' ') + "...")};
});

